import math

def calculate_minimum_angle(n, coordinates):
    an = []
    ep = 10 * -16
    for (x, y) in coordinates:
        if x > 0 and y > 0:
            an.append(180 * math.atan(abs(y) / (abs(x) + ep)) / math.pi)
        elif x < 0 and y > 0:
            an.append(180 - 180 * math.atan(abs(y) / (abs(x) + ep)) / math.pi)
        elif x < 0 and y < 0:
            an.append(180 + 180 * math.atan(abs(y) / (abs(x) + ep)) / math.pi)
        elif x > 0 and y < 0:
            an.append(360 - 180 * math.atan(abs(y) / (abs(x) + ep)) / math.pi)
        elif x == 0 and y > 0:
            an.append(90.0)
        elif x == 0 and y < 0:
            an.append(270.0)
        elif x > 0 and y == 0:
            an.append(0.0)
        elif x < 0 and y == 0:
            an.append(180.0)
    an.sort()
    an = [-360.0 + an[-1]] + an
    dif = []
    for i in range(n):
        dif.append(an[i + 1] - an[i])
    return 360.0 - max(dif)

